import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route, Link, useLocation } from 'react-router-dom';

// Import components (nếu có file .js)
// import ScoreLookup from './components/ScoreLookup.js';
// import ScoreLevels from './components/ScoreLevels.js';
// import TopStudents from './components/TopStudents.js';

const menuItems = [
  { path: '/', label: 'Dashboard' },
  { path: '/search-scores', label: 'Search Scores' },
  { path: '/score-levels', label: 'Score Levels' },
  { path: '/top-students', label: 'Top 10 Students' },
  { path: '/reports', label: 'Reports' },
  { path: '/settings', label: 'Settings' },
];

// Dashboard Component
const Dashboard = () => {
  return (
    <div style={{ 
      background: 'white', 
      borderRadius: '12px', 
      padding: '24px', 
      boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
      marginBottom: '24px'
    }}>
      <h2 style={{ color: '#1428a0', marginBottom: '16px' }}>Welcome to G-Scores</h2>
      <p>Exam Scores Management System</p>
      <div style={{ marginTop: '20px' }}>
        <h3>Quick Actions:</h3>
        <ul>
          <li>Search student scores by registration number</li>
          <li>View score level reports</li>
          <li>Check top 10 students</li>
          <li>Generate detailed reports</li>
        </ul>
      </div>
    </div>
  );
};

// Search Scores Component
const SearchScores = () => {
  return (
    <div style={{ 
      background: 'white', 
      borderRadius: '12px', 
      padding: '24px', 
      boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
      marginBottom: '24px'
    }}>
      <h2 style={{ color: '#1428a0', marginBottom: '16px' }}>Search Scores</h2>
      <div style={{ marginBottom: '16px' }}>
        <label style={{ display: 'block', marginBottom: '8px', fontWeight: 'bold' }}>
          Registration Number:
        </label>
        <input 
          type="text" 
          placeholder="Enter registration number" 
          style={{ 
            padding: '8px 12px', 
            border: '1px solid #ddd', 
            borderRadius: '4px', 
            marginRight: '8px',
            width: '200px'
          }} 
        />
        <button style={{ 
          padding: '8px 16px', 
          background: '#1428a0', 
          color: 'white', 
          border: 'none', 
          borderRadius: '4px',
          cursor: 'pointer'
        }}>
          Submit
        </button>
      </div>
    </div>
  );
};

// Score Levels Component
const ScoreLevels = () => {
  return (
    <div style={{ 
      background: 'white', 
      borderRadius: '12px', 
      padding: '24px', 
      boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
      marginBottom: '24px'
    }}>
      <h2 style={{ color: '#1428a0', marginBottom: '16px' }}>Score Levels Report</h2>
      <p>Score level statistics will be displayed here.</p>
      <p>Backend API: http://localhost:3001/api/students/score-levels</p>
    </div>
  );
};

// Top Students Component
const TopStudents = () => {
  return (
    <div style={{ 
      background: 'white', 
      borderRadius: '12px', 
      padding: '24px', 
      boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
      marginBottom: '24px'
    }}>
      <h2 style={{ color: '#1428a0', marginBottom: '16px' }}>Top 10 Students</h2>
      <p>Top 10 Group A students will be displayed here.</p>
      <p>Backend API: http://localhost:3001/api/students/top-10-group-a</p>
    </div>
  );
};

// Reports Component
const Reports = () => {
  return (
    <div style={{ 
      background: 'white', 
      borderRadius: '12px', 
      padding: '24px', 
      boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
      marginBottom: '24px'
    }}>
      <h2 style={{ color: '#1428a0', marginBottom: '16px' }}>Reports</h2>
      <p>Detailed reports and analytics will be displayed here.</p>
    </div>
  );
};

// Settings Component
const Settings = () => {
  return (
    <div style={{ 
      background: 'white', 
      borderRadius: '12px', 
      padding: '24px', 
      boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
      marginBottom: '24px'
    }}>
      <h2 style={{ color: '#1428a0', marginBottom: '16px' }}>Settings</h2>
      <p>Application settings and configuration options.</p>
    </div>
  );
};

const Sidebar = () => {
  const location = useLocation();
  return (
    <div style={{ width: '220px', background: 'linear-gradient(to bottom, #ffe259, #3a8dde)', color: '#222', padding: '30px 0 0 0', minHeight: '100%' }}>
      <div style={{ fontWeight: 'bold', fontSize: '1.3rem', marginBottom: '30px', textAlign: 'center' }}>Menu</div>
      <ul style={{ listStyle: 'none', padding: 0, margin: 0 }}>
        {menuItems.map((item) => (
          <li
            key={item.path}
            style={{
              padding: '12px 30px',
              cursor: 'pointer',
              fontWeight: location.pathname === item.path ? 'bold' : 'normal',
              background: location.pathname === item.path ? 'rgba(0,0,0,0.10)' : 'none',
              borderLeft: location.pathname === item.path ? '4px solid #1428a0' : '4px solid transparent',
              transition: 'background 0.2s, border-left 0.2s',
            }}
          >
            <Link to={item.path} style={{ textDecoration: 'none', color: 'inherit', display: 'block', width: '100%' }}>{item.label}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

function App() {
  return (
    <Router>
      <div style={{ display: 'flex', flexDirection: 'column', height: '100vh' }}>
        {/* Header */}
        <div style={{ background: '#1428a0', color: 'white', padding: '20px 0', textAlign: 'center', fontSize: '2rem', fontWeight: 'bold' }}>
          G-Scores
        </div>
        <div style={{ display: 'flex', flex: 1 }}>
          {/* Sidebar */}
          <Sidebar />
          {/* Main Content */}
          <div style={{ flex: 1, background: '#f7f8fa', padding: '40px 30px', overflowY: 'auto' }}>
            <Routes>
              <Route path="/" element={<Dashboard />} />
              <Route path="/search-scores" element={<SearchScores />} />
              <Route path="/score-levels" element={<ScoreLevels />} />
              <Route path="/top-students" element={<TopStudents />} />
              <Route path="/reports" element={<Reports />} />
              <Route path="/settings" element={<Settings />} />
            </Routes>
          </div>
        </div>
      </div>
    </Router>
  );
}

export default App;
